import React, { useState } from 'react';
import axios from 'axios';

function UserEntry() {
  const [formData, setFormData] = useState({
    name: '',
    phoneNumber: '',
    address: '',
    amount:'',
    Deadline:'',
    Document:null
  });

  const handleChange = e => {
    if (e.target.name === 'Document') {
      setFormData({ ...formData, [e.target.name]: e.target.files[0] }); // Save the file object
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };
  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const formDataToSend = new FormData();
      formDataToSend.append('name', formData.name);
      formDataToSend.append('phoneNumber', formData.phoneNumber);
      formDataToSend.append('address', formData.address);
      formDataToSend.append('amount', formData.amount);
      formDataToSend.append('Deadline', formData.Deadline);
      formDataToSend.append('Document', formData.Document); // Append the file object to formData

      const res = await axios.post('http://localhost:3005/users', formDataToSend, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      console.log(res.data);
      setFormData({
        name: '',
        phoneNumber: '',
        address: '',
        amount:'',
        Deadline:'',
        Document: null // Reset file object after submission
      });
    } catch (err) {
      console.error(err);
    }
  };

  // const handleSubmit = async e => {
  //   e.preventDefault();
  //   try {

  //     const formDataToSend = new FormData();
  //     formDataToSend.append('name', formData.name);
  //     formDataToSend.append('phoneNumber', formData.phoneNumber);
  //     formDataToSend.append('address', formData.address);
  //     formDataToSend.append('amount', formData.amount);
  //     formDataToSend.append('Deadline', formData.Deadline);
  //     formDataToSend.append('Document', formData.Document); 

  //     const res = await axios.post('http://localhost:3005/users', formData);
  //     console.log(res.data);
  //     setFormData({
  //       name: '',
  //       phoneNumber: '',
  //       address: '',
  //       amount:'',
  //       Deadline:'',
  //       Document:''
  //     })
  //   } catch (err) {
  //     console.error(err);
  //   }
  // };

  return (
    <form onSubmit={handleSubmit} className='Type-Form'>
      <div className='Main-InputFlied'>
      <div className='Name_Phone_Address'>
      <label htmlFor="UserName">UserName:</label>
      <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} />

      <label htmlFor="PhoneNumber">PhoneNumber:</label>
      <input type="text" name="phoneNumber" placeholder="Phone Number" value={formData.phoneNumber} onChange={handleChange} />

      <label htmlFor="Address">Address:</label>
      <input type="text" name="address" placeholder="Address" value={formData.address} onChange={handleChange} />
      </div>
      
      <div className='Amount-DeadLine-Document'>
      <label htmlFor="Amount">Amount:</label>
      <input type="text" name="amount" placeholder="amount" value={formData.amount} onChange={handleChange} />
      <label htmlFor="Deadline">Deadline:</label>
      <input type="text" name="Deadline" placeholder="Deadline" value={formData.Deadline} onChange={handleChange} />

      <label htmlFor="Document">Document:</label>
      <input type="file" name="Document" placeholder="Document" accept='image/*' onChange={handleChange} />
      

      </div>
      </div>

      <div className='Main-Button'>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
}

export default UserEntry;
